import { Img } from './trash-alt-regular.svg'
import './App.css';



function App() {
  return (
    <div className="App">
      <header>
        <h1 className="center">Todo Tracker</h1>
      </header>
      <body>
      <form  class="add-form" >
        <div class="form-control">
          <label for="text">Task:</label>
          <input
            type="text"
            name="text"
            id="text"
            placeholder="Add Task"
          />
        </div>
        <input type="submit" class="green" value="Save Task" class="btn btn-block" />
      </form>

      <h3>
    <Img />
  </h3>
  <p></p>
      </body>
    </div>
  );
}

export default App;
